import axios from 'axios';
import React, { useState } from 'react';

const SwipeComponent = () => {
  const [recommendations, setRecommendations] = useState([]);

  const handleSwipeRight = async (houseId) => {
    try {
      const response = await axios.post('http://localhost:5000/recommend', {
        houseId,
      });
      setRecommendations(response.data);
      console.log('Recommended Houses:', response.data);
    } catch (error) {
      console.error('Error fetching recommendations:', error);
    }
  };

  return (
    <div>
      <h1>Swipe Right on a House</h1>
      <button onClick={() => handleSwipeRight(10)}>Swipe Right on House 10</button>
      <h2>Recommendations:</h2>
      <ul>
        {recommendations.map((house, index) => (
          <li key={index}>
            {house.BROKERTITLE}, {house.TYPE}, ${house.PRICE}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default SwipeComponent;
